// MainApp.js
import React from 'react';

const MainApp = () => {
  return (
    <div>
      <h1>Welcome to the Online Voting Portal</h1>
      <div className="user-auth-links">
        <a href="/login">Login</a>
        <a href="/signup">Sign Up</a>
      </div>
    </div>
  );
}

export default MainApp;
